const InvoicesFilter = () => {

    return (
        <>
            <form>
            <InputField
                    required={true}
                    type="text"
                    name="invoiceNumber"
                    label="Číslo faktury"
                    min="3"
                    prompt="Zadejte číslo faktury"
                    value={invoice.invoiceNumber}
                    handleChange={(e) => {
                        setInvoice({...invoice, invoiceNumber: e.target.value});
                    }}
                />
            </form>
        </>
    )
}

export default InvoicesFilter;
